import React, { Component } from 'react';
import axios from 'axios';

class Blog extends Component{
    constructor(props){
        super(props);
        axios.get("/").then(response => {
            console.log(response);
        }).catch(response => {
            console.log(response);
        })
    }

    render() {
        return (
            <div>
                Blog's Page
            </div>
        )
    }
}

export default Blog;
